import React, { useState } from "react";
const Index = () => {
  const [text, setText] = useState("");
  return (
    <>
      <input
        type="text"
        placeholder="enter some text"
        value={text}
        onChange={(e) => setText(e.target.value)}
      />
      <button>submit</button>
    </>
  );
};
export default Index;
